import React, { Component } from 'react';
import NavBar from './NavBar.js';
import classNames from 'classnames';
import './App.css';
import Tachyonsocialfooter from './Tachyonsocialfooter.js'
import { Container, Row, Col } from 'reactstrap';
import Academics from './Academics.js';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Portrait from './Portrait.js';
import Languages from './Languages.js';
import Fun from './Fun.js';
import Work from './Work.js';
import Projects from './Projects.js';
import {Tabs, Tab} from 'react-bootstrap'
import Anchor from './Anchor.js';


import code from './images/code.jpeg';


class App extends Component {

  componentDidMount(){
    AOS.init({
      duration : 1800,
    })
  }


  render() {

    return (
      <div className={classNames("App", this.state)}>
       <NavBar/>

        <div className="App-body">


        <Container id="App-body">
                <Row className="padded-top">
                  <Col>
                    <div data-aos="zoom-in-up"><Portrait></Portrait></div>
                  </Col>
                  <Col>
                    <h1>Scott Lau Stubbs</h1> <br/>
                    <img
                      className = {classNames("circles")}
                      src = {code}
                      alt = {"hack"}
                      width="30%"
                    /> Projects
                    <h2> Friend </h2>
                    <h2> Family </h2>
                  </Col>
                </Row>

                <br/>
          </Container>



          <Tabs defaultActiveKey="Projects" id="uncontrolled-tab-example">

          <Tab eventKey="tools" title="Languages/Tools">
          <Container id="Languages">
                <Row className="padded-top">
                  <Languages/>
                </Row>
              </Container>
          </Tab>

          <Tab eventKey="Academics" title="Academics">
          <Container id="Academics">
                <Row className="padded-top">
                  <Academics></Academics>
                </Row>
              </Container>
          </Tab>

          <Tab eventKey="Work" title="Work">
          <Container id="Jobs">
                <Row className="padded-top">
                  <Col>
                    <Work/>
                  </Col>
                </Row>
              </Container>

          </Tab>

          <Tab eventKey="Fun" title="Fun">
            <Container id="Fun">
              <Row className="padded-top">
                <Fun/>
              </Row>
            </Container>
          </Tab>

          <Tab eventKey="Projects" title="Projects">
            <Container id="Projects">
              <Row className="padded-top">
                <Projects/>
              </Row>
            </Container>
          </Tab>

          </Tabs>

          <div id="bottom"> <hr/>
            <Tachyonsocialfooter></Tachyonsocialfooter>
          </div>


          </div>


      </div>

    );
  }
}

export default App;
